import React, { Component, Fragment } from 'react';
import CampCard from './CampCard/CampCard,js';
import {
  Wrapper,
} from './Camps.styled.js';

class Camps extends Component {
  constructor(props){
    super(props);
    this.state={};
  }

  render() {
    return (
      <Wrapper id="camps">
        <CampCard />
      </Wrapper>
    );
  }
}

export default Camps;
